wwv_flow_imp_page.create_page_process(
 p_id=>wwv_flow_imp.id(2773783895046526)
,p_process_sequence=>10
,p_process_point=>'AFTER_SUBMIT'
,p_process_type=>'NATIVE_PLSQL'
,p_process_name=>'Process/Deposit Withdraw'
,p_process_sql_clob=>wwv_flow_string.join(wwv_flow_t_varchar2(
'declare',
'   v_account_number varchar2(20) := :p6_account_number;',
'   v_amount         number := :p6_amount;',
'   v_trans_type     varchar2(10) := :p6_radio;',
'   v_user_id        number;',
'begin',
' SELECT user_id',
'INTO v_user_id',
'FROM app_users',
'WHERE LOWER(username) = LOWER(V(''APP_USER''));',
'',
'   if v_trans_type = ''Deposit'' then',
'      transaction_pkg.deposit(',
'         p_account_number => v_account_number,',
'         p_amount         => v_amount,',
'         p_createdby      => v_user_id',
'      );',
'   elsif v_trans_type = ''Withdrawal'' then',
'      transaction_pkg.withdraw(',
'         p_account_number => v_account_number,',
'         p_amount         => v_amount,',
'         p_createdby      => v_user_id',
'      );',
'   else',
'      raise_application_error(',
'         -20010,',
'         ''Invalid transaction type selected''',
'      );',
'   end if;',
'',
'',
'exception',
'   when no_data_found then',
'      raise_application_error(',
'         -20001,',
'         ''Logged-in user not found: '' || :app_user',
'      );',
'   when others then',
'      raise;',
'end;'))
,p_process_clob_language=>'PLSQL'
,p_error_display_location=>'INLINE_IN_NOTIFICATION'
,p_process_when_button_id=>wwv_flow_imp.id(3570711494814110)
,p_internal_uid=>2773783895046526
);
